// Buns component
import React from 'react';
import { useOutletContext } from 'react-router-dom';
import Navbar from './Navbar';

function Buns() {
  const { data } = useOutletContext();

  return (
    <div>
      <Navbar />
      <h2>Buns</h2>
      {data.map((item) => (
        <small key={item.id}>{item.name}</small>
      ))}
    </div>
  );
}

export default Buns;
